  <p>O plano aqui  simples, fundo esttico com animao leve, texto na frente com destaque no plano e uma descrio mdia para destacar o servio, um boto CTA e um para obter ainda mais detalhes (do cardpio). Um outro detalhe interessante, est nas abas acima, de tempo em tempo, a aba passar para prxima, com uma animaozinha bem suave.</p>

