  <p>Agora  claro, no vou colocar o feedback completo em uma tela, para as pessoas que so querem ver o breve, isso normalmente  tudo que precisam, porm para os mais cticos, tenho uma imagem de fcil acesso que podem abrir no celular prprio para verem o feedback do jeito que foi enviado!</p>

